import React from "react";
import { Link } from "react-router-dom";

function Home() {
  return (
    <div className="h-screen flex items-center justify-center">
      <p>Welcome to Noter</p>
      <div className="w-full flex-row justify-evenly">
        <Link to={"/allnotes"}></Link>
      </div>
    </div>
  );
}

export default Home;
